	}

		var objDiv = $('#'+_objId);

 	function simulation(){
 		var r = Math.floor(Math.random() * 7);
		var _id = Math.floor(Math.random() * 5);
 		console.log('r:'+r);
 		if(r == 0){
 			if(animate_state[_id] == 'start'){
 				actBlink(_id,'stop');
 			}else if(animate_state[_id] == 'stop' || animate_state[_id] == null){
 				actBlink(_id,'start');
 			} 
 		}else if(r == 1){
 			if(animate_state[_id] == 'start'){
 				actBlink(_id,'stop');
 			}else if(animate_state[_id] == 'stop' || animate_state[_id] == null){
 				actBlink(_id,'start');
 			} 
 		}else if(r == 2){
 			//console.dir($('#'+_id));
			$('#'+_id).attr('fill','#9BBB59');
 		}else if(r == 3){
			$('#'+_id).attr('fill','#3434FF');

 			if(animate_state3[_id] == 'start'){

 			}else if(animate_state3[_id] == 'stop' || animate_state3[_id] == null){
